import React from 'react';
import '../styles/pan.css';

function PanCorner() {
  return (
    <div className="coming-soon-simple">
      <div className="simple-content">
        <h1>Coming Soon</h1>
        <p>We're working on something exciting!</p>
        <div className="divider"></div>
        <p className="contact">Stay tuned or contact us at hello@example.com</p>
      </div>
    </div>
  );
}

export default PanCorner;
